import Link from "next/link";

const Nav = () => {
  return (
    <nav className="">
      <div>
        <ul className="flex justify-around">
          <li>Dashboard</li>
          <li>Tickets</li>
          <li>
            <Link href="/vendors">
              <a>Vendors</a>
            </Link>
          </li>
          <li>Contracts</li>
          <li>
            <Link href="/commodities">
              <a>Commodities</a>
            </Link>
          </li>
          <li>Reports</li>
        </ul>
      </div>
    </nav>
  );
};

export default Nav;
